        <img 
          className={styles.circuloColorido}
          src={circuloColorido}
          aria-hidden={true}
        />
         <img
          className={styles.minhaFoto}
          src={minhaFoto}
          alt="Foto teste"
         />

      </div>
      
    </div>
  )
}
